import React from "react";

// 5! = 5 *4*3*2*1

function factor(f) {
  for (let index = 2; index < f + 1; index++) {
    x *= index;
  }
  return x;
}
console.log(factor(3));

const App = () => {
  return <div>Hellow</div>;
};

export default App;
